INSERT INTO `articulos` (`id`, `titulo`, `intro`, `fecha`, `descripcion`, `publicado`, `destacada`, `categoria`, `imagen`) VALUES
(18, 'Seguro de Vivienda', 'Es el seguro que cubre las riesgos que afectan a las personas. El contrato de seguro sobre las personas comprende todos los riesgos que puedan afectar a la existencia, integridad corporal o salud de un asegurado.', '2013-01-31', '<p>Seguro de accidentes, cuando el riesgo que se quiere prevenir es la  posibilidad de sufrir un menoscabo f&iacute;sico personal como consecuencia de  un accidente.</p>\r\n<p>Este seguro cubre la lesi&oacute;n corporal por causa de accidentes. A estos  efectos la Ley de Espa&ntilde;a define al accidente como aquella lesi&oacute;n  corporal que deriva de una causa violenta, s&uacute;bita, externa y ajena a la  intencionalidad del asegurado, que produzca invalidez temporal o  permanente o muerte.</p>\r\n<p>Las p&oacute;lizas configuran cuidadosamente el riesgo cubierto mediante un sistema de delimitaciones, principalmente causales.</p>\r\n<p>Como el contrato de seguro de vida, se pueden designar beneficiarios  por el contratante asegurado que percibir&aacute;n la indemnizaci&oacute;n: capital  asegurado, en el caso de muerte. De no existir beneficiarios, pasar&aacute; el  derecho a los herederos del muerto. En el supuesto de invalidez  permanente, el valor del da&ntilde;o indemnizable se determina con arreglo a  una escala de porcentajes adecuada a las distintas manifestaciones o  clases de incapacidad. En la incapacidad temporal se abona al asegurado  una cantidad o dieta asegurada por el tiempo que dure la incapacidad. La  provocaci&oacute;n voluntaria del siniestro por parte del asegurado libera al  asegurador del cumplimiento de su obligaci&oacute;n. La p&oacute;liza puede extenderse  a la cobertura de los gastos sanitarios, siempre que se realice de  acuerdo con las condiciones pactadas. Esta modalidad del seguro de  personas es la &uacute;nica del ramo en el que el <a title="Consorcio de Compensaci&oacute;n de Seguros" href="http://es.wikipedia.org/wiki/Consorcio_de_Compensaci%C3%B3n_de_Seguros">Consorcio de Compensaci&oacute;n de Seguros</a> entra en relaci&oacute;n con los riesgos extraordinarios.</p>\r\n<p>Se puede asegurar tambi&eacute;n el riesgo de sufrir una invalidez,  estableciendo el pago de una cantidad para el caso de la invalidez  permanente absoluta o total y cantidades a determinar seg&uacute;n un baremo o  escala si la invalidez es parcial.</p>', 'S', 'S', 'B', 'imagen_20130419065725.jpg'),
(19, 'Trabajo en Equipo', 'Trabajo en Equipo', '2013-04-03', '<p>Trabajo en Equipo</p>', 'S', 'S', 'B', 'imagen_20130419065656.jpg');
